import time

def merge(left, right):
    l = []
    i = 0
    j = 0

    while i < len(left) and j < len(right):
        if left[i] < right[j]:
            l.append(left[i])
            i += 1
        else:
            l.append(right[j])
            j += 1

    while i < len(left):
        l.append(left[i])
        i += 1
    while j < len(right):
        l.append(right[j])
        j += 1
    return l

def split(lista):
    mid = len(lista) // 2
    left = lista[:mid]
    right = lista[mid:]
    return left, right



def mergeSort(lista):
    if(len(lista) <= 1):
        return lista
    left_list, right_list = split(lista)
    left = mergeSort(left_list)
    right = mergeSort(right_list)
    return merge(left, right)


